import React from 'react';
import Navbar from '../components/navbar';

function About() {
    return (
        <>
        <Navbar></Navbar>
        <div class="form-body">
            <div class="row">
                <div class="form-holder">
                    <div class="form-content">
                        <div class="form-items">
                            <h3> כך הכל התחיל.
                                אפרת ומוריה שמעו הרצאה על ארגון נפלא,
                                על מערך שלם, מורכב, מפורט, שעושה כל כך הרבה טוב עם כל כך הרבה אנשים,
                                אז רק רצינו חלק בזה.
                                להביא את מה שאנחנו יכולות לעשות, להביא את היתרון של המכונה, ולתת לאנשי הציבור המדהימים האלה שאין להם תחליף יכולת לעזור בקלות וביעילות:)
                            </h3>
                        </div>
                    </div>
                </div>
            </div>
        </div>
        </>
    );
};
export default About;
